import React from 'react';
import './profile.css';



class profile extends React.Component {
     constructor(props) {
          super(props);
          this.state =({
             user: []
          //User is the current signed in user profile sent from the database
          })
        }
    
     render(){
          return(
          <div className="profile">
               Profile
               {(this.state)}
          </div>
          )
     }
}
export default profile;
